    public function getSourceContext()
    {
        return new Source("{% extends 'home_admin/index.html.twig' %}

{% block title %}Maison index{% endblock %}

{% block content %}
    <br> <br> <br> <br> <br>
    <h1>Maison index</h1>
<input type=\"text\" placeholder=\"search....\" id=\"search\" onkeyup=\"searchh()\" class=\"form-control mb-3\"/>
<div id=\"show\">
    <table class=\"table\">
        <thead>
        <tr>
            <th>Nom</th>
            <th>Type</th>
            <th>Disponibilite</th>
            <th>Adresse</th>
            <th>Description</th>
            <th>Prix</th>
            <th>Image</th>
            <th>actions</th>
        </tr>
        </thead>
        <tbody>
        {% for maison in maisons %}
            <tr>
                <td>{{ maison.Nom }}</td>
                <td>{{ maison.type }}</td>
                <td>{{ maison.Disponibilite ? 'Yes' : 'No' }}</td>
                <td>{{ maison.adresse }}</td>
                <td>{{ maison.description }}</td>
                <td>{{ maison.prix }}</td>
                <td>{{ maison.image }}</td>
                <td>
                    <a href=\"{{ path('ADeleteMaison', {'id': maison.id}) }}\">supprimer</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"8\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>
</div>
{% endblock %}
    {% block js %}
        <script>
            function searchh(){
                var sch=\$(\"#search\").val();
                \$.ajax({
                    url: \"{{ path('search') }}\",
                    data:{dat: sch},
                    type: \"POST\",
                    success: function(data){
                        console.log('okkk');
                        \$('#show').html(data).show();
                    }
                });
            }
        </script>
    {% endblock %}", "home_admin/gestionMaison.html.twig", "C:\\Users\\Asus\\Desktop\\reservi\\templates\\home_admin\\gestionMaison.html.twig");
